(defn parse-longs [s]
  (->> (re-seq #"-?\d+" s)
       (map parse-long)))

(defn parse-input [input]
  (vec (parse-longs input)))

(defn insert-at [v idx val]
  (into (conj (subvec v 0 idx) val)
        (subvec v idx)))

(defn remove-at [v idx]
  (into (subvec v 0 idx)
        (subvec v (inc idx))))

(defn mix [original to-mix]
  (loop [mixed to-mix, idx 0]
    (if (< idx (count mixed))
      (let [number (nth original idx)
            old-idx (.indexOf mixed number)
            move (+ old-idx (:v number))
            new-idx (if (zero? move)
                      (dec (count mixed))
                      (mod move (dec (count mixed))))]
        (recur (-> mixed
                   (remove-at old-idx)
                   (insert-at new-idx number))
               (inc idx)))
      mixed)))

(defn grove-coords [numbers decryption-key mix-count]
  (let [encrypted-file (vec (map-indexed (fn [idx v]
                                           {:idx idx, :v (* v decryption-key)}) numbers))
        zero (get encrypted-file (.indexOf numbers 0))
        mixed (nth (iterate #(mix encrypted-file %) encrypted-file) mix-count)
        nth-after-zero #(:v (get mixed (mod (+ (.indexOf mixed zero) %) (count mixed))))]
    (+ (nth-after-zero 1000)
       (nth-after-zero 2000)
       (nth-after-zero 3000))))

(defn part1 []
  (grove-coords (parse-input input) 1 1))

(defn part2 []
  (grove-coords (parse-input input) 811589153 10))